import { useSelector, useDispatch } from 'react-redux';

function CoinContainer() {
    const Coindata = useSelector(state => state.Coin.marketNames);
    //console.log(Object.values(Coindata));
    return (
        <ul>
            {
                Coindata.map(coin => (
                    <li key={coin}>
                        <div>{coin}</div>
                    </li>
                ))
            }
        </ul>
    )
}

export default CoinContainer;
